                                <div class=""ml-5""> <small>{{BancoSelected}}</small> </div>
                            </v-card-title>
                            <v-card-text>
                                <p class=""text-center"">
                                    Para todos los efectos y consecuencias derivadas de la aplicacin y alcance de este contrato y con el fin de lograr una correcta y exacta interpretacin de este documento las siguientes palabras, utilizadas en singular o plural, maysculas o minsculas, resaltadas o no, femenino o masculino, y salvo que el contexto lo requiera de otra forma, las palabras o expresiones definidas en singular incluirn su forma plural y viceversa, teniendo todas ellas el nico y exclusivo significado que se indica a continuacin:

                                </p>

                                <p class=""text-justify"">
                                    EL BANCO: Corresponde a la persona jurdica i");
            WriteLiteral(@"dentificada en el encabezado de este documento.
                                </p>
                                <p class=""text-justify"">
                                    EL CLIENTE: Es la persona natural o jurdica titular de una cuenta o de cualquier otro servicio o producto ofrecido por EL BANCO quien, luego de cumplir las formalidades propias de afiliacin al sistema de Banca Electrnica o Banca por Internet, particularmente al Sistema TuFactoring, quien, siendo aceptante o deudor de una o varias facturas, registre dichos instrumentos en el Sistema de manera que pudieran ser objeto de subasta para el pago anticipado de las mismas a sus proveedores o simplemente su pago al vencimiento.
                                </p>
                                <p class=""text-justify"">
                                    SISTEMA TUFACTORING ( Sistema): Corresponde a un Desarrollo Tecnolgico que permite al CLIENTE, a travs del uso de los canales de banca por internet, realizar operaciones de registr");
            WriteLiteral(@"o, venta, compra, ordenar el pago o ceder Facturas de sus PROVEEDORES, as como intercambiar informacin exclusivamente relacionada con dichas Facturas.
                                </p>
                                <p class=""text-justify"">
                                    EMPRESA: Corresponde a la sociedad mercantil TUFACTORING SERVICIOS C.A. domiciliada en la ciudad de Caracas, Distrito Capital, constituida por documento inscrito por ante el Registro Mercantil xx de la Circunscripcin Judicial del Distrito Capital y Estado Miranda, en fecha xxxxx de xxxxxx de xxxxx, bajo el N. xx, Tomo xxxxxx. Creadora, propietaria y operadora del SISTEMA TUFACTORING.
                                </p>
                                <p class=""text-justify"">
                                    CLAVES DE ACCESO: Corresponde a un mecanismo de Seguridad de la Informacin Electrnica, constante de factores de autenticacin tendentes a verificar la identidad de EL CLIENTE y de EL BANCO y la cualidad de stos pa");
            WriteLiteral(@"ra realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticacin correspondern a aquellos establecidos como Factor de autenticacin categoras 2 y 3 de acuerdo a la Resolucin N 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las Normas que Regulan el Uso de los Servicios de la Banca Electrnica, publicada en la Gaceta Oficial de la Repblica Bolivariana de Venezuela N 39.597 de fecha 19 de enero de 2011.
                                </p>
                                <p class=""text-justify"">
                                    DAS HBILES BANCARIOS: Corresponde a los das comprendidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
                                </p>
                                <p class=""text-justify"">
                                    DERECHO DE CRDITO: corresponde al derecho que tiene el acreedor de una deuda que EL CLIENTE tiene obligaci");
            WriteLiteral(@"n de pagar conforme a la Factura.
                                </p>
                                <p class=""text-justify"">
                                    DESCUENTO: A los nicos efectos de este contrato, corresponde a la cantidad resultante de aplicar la siguiente frmula, al momento de efectuar las operaciones de venta de factura a travs del Sistema:
                                </p>
                                <p class=""text-justify"">
                                    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(VNXTD)<br />
                                    D=  _________ND<br />
                                    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(360)
                                </p>
                                <p class=""text-justify"">
                                    Donde ""D"" significa Descuento, ""VN"" significa Valor Neto, ""TD"" significa Tasa de Descuento; ""ND"" significa el nmero de das que resulte de sumar los das naturales desde e inclusive la fecha en que se ");
            WriteLiteral(@"entregue al Proveedor el Precio de venta, respecto de un Derecho Adquirido, hasta inclusive la fecha de vencimiento de dicho derecho de Crdito.
                                </p>
                                <p class=""text-justify"">
                                    FACTURA: Corresponde al documento o ttulo de carcter mercantil contentivo de una obligacin de pago con ocasin de la adquisicin de bienes o servicios por parte de EL CLIENTE.
                                </p>
                                <p class=""text-justify"">
                                    GASTO POR SERVICIO: Corresponde al monto que obtendr LA EMPRESA con ocasin a la operacin efectiva de la venta de Factura a El INVERSIONISTA o EL BANCO. Este monto corresponder al resultado de la frmula aplicable sobre el valor de cada Factura, que ser descontado del precio de venta que recibir EL PROVEEDOR. Este valor puede ser consultado en la pgina del Sistema.
                                </p>
                     ");
            WriteLiteral(@"           <p class=""text-justify"">
                                    INVERSIONISTA. Es la persona natural o jurdica que se convierte en acreedora de El CLIENTE como consecuencia de transacciones de compra de Facturas expedidas por EL PROVEEDOR originario, y a favor de quien este ltimo acepta su cesin una vez que acepta el descuento ofertado por el Valor Neto de la factura subastada.
                                </p>
                                <p class=""text-justify"">
                                    VALOR NETO. Se refiere al monto resultante de restar al valor numrico expresado en el texto de la Factura todos los tributos o retenciones a los que hubiere lugar, incluso las notas de crdito, si existiesen. Dicho valor debe ser cargado por EL CLIENTE en el Sistema. En el caso del pago al vencimiento, EL BANCO podr proceder a pagar dicho valor a EL PROVEEDOR o a EL INVERSIONISTA y, en caso de haberla comprado EL BANCO, retirar el monto correspondiente de la(s) cuenta(s) de EL CLIENTE o impu");
            WriteLiteral(@"tarlo a la lnea de crdito correspondiente, de ser el caso.
                                </p>
                                <p class=""text-justify"">
                                    PRECIO DE VENTA: Corresponde al resultado de haber deducido del valor neto de las facturas, antes explicado, la tasa de descuento ofertada por EL INVERSIONISTA y aceptada por EL PROVEEDOR.
                                </p>
                                <p class=""text-justify"">
                                    PROVEEDOR. Es la persona natural o jurdica acreedora del CLIENTE como consecuencia de transacciones comerciales consistentes en la venta o suministro de bienes y/o servicios, por lo cual ha expedido una(s) Factura(s) cuyo(s) pago(s) est(n) a cargo del CLIENTE.
                                </p>
                                <p class=""text-justify"">
                                    TASA DE DESCUENTO: Corresponde a la tasa aceptada por EL PROVEEDOR para determinar el Descuento, la cual es ofer");
            WriteLiteral(@"tada por EL INVERSIONISTA durante el horario en que este activo el Mercado Electrnico y para cada operacin de venta que realicen al amparo de este contrato. El clculo del Descuento se realizar desde la fecha en que se efecte el anticipo de fondos, hasta la fecha del vencimiento de la Factura.
                                </p>
                                <p class=""text-justify"">
                                    <b><u>CLUSULA PRIMERA</u></b>: En virtud del presente documento, EL PROVEEDOR manifiesta su conocimiento y expresa conformidad sobre la existencia de un Contrato de Servicio Confirming a travs del Sistema TuFactoring que ha sido suscrito entre EL CLIENTE y EL BANCO, y en razn del mismo, conviene y acepta en ceder a EL INVERSIONISTA los Derechos de Crdito derivados de las Facturas con cargo a EL CLIENTE y a su favor, en las condiciones establecidas en el presente contrato; entendiendo que las Facturas fueron registradas previamente en el Sistema Tufactoring y que bastar que EL PROV");
            WriteLiteral(@"EEDOR autorice su oferta por medio del Sistema y que haya aceptado el Descuento ofertado para que surta efecto la cesin a EL INVERSIONISTA, segn sea el caso, de los derechos de cobro de la(s) factura(s), para todos los efectos legales, una vez que el pago se encuentre disponible en  la cuenta desde la cual se materializar el pago a EL PROVEEDOR.
                                </p>
                                <p class=""text-justify"">
                                    EL PROVEEDOR, quien se encuentra en conocimiento de los trminos y condiciones de uso del Sistema TuFactoring, ratifica su conformidad para que EL CLIENTE a travs de EL BANCO le pague directamente a l o a EL INVERSIONISTA que haya adquirido las Facturas en el Sistema o que de haberla adquirido EL BANCO, ste ltimo haga el cobro respectivo o lo impute a la lnea de crdito o de confirming abierta a tal efecto, en los trminos de este contrato.
                                </p>
                                <p class=""text-just");
            WriteLiteral(@"ify"">
                                    Las partes intervinientes en la operacin convienen en que la formalizacin de las operaciones de venta de Facturas en la forma prevista en el presente contrato, harn prueba de la notificacin y recepcin de la transmisin de los Derechos de Crdito, as como la aceptacin por parte de EL PROVEEDOR de dicha transmisin a favor de EL BANCO o de EL INVERSIONISTA, segn sea el caso. No obstante, EL PROVEEDOR una vez que acepta el Descuento ofertado por la factura subastada, confirma dicha aceptacin al manifestar su acuerdo con el contenido del contrato de cesin que se abrir en la pgina al llegar a ese punto de la operacin.
                                </p>
                                <p class=""text-justify"">
                                    <b><u>CLUSULA SEGUNDA:</u></b> Las Facturas que a solicitud de EL PROVEEDOR vayan a ser autorizadas para ser vendidas o descontadas por medio del Sistema Tufactoring, debern estar autorizadas por la persona con l");
            WriteLiteral(@"as facultades para vender activos de la empresa.
                                </p>
                                <p class=""text-justify"">
                                    <b><u>CLUSULA TERCERA:</u></b> EL PROVEEDOR manifiesta que en caso de no tener operativa una Cuenta en EL BANCO en la cual se depositen los importes correspondientes a los fondos provenientes de la liquidacin de la operacin de venta de Facturas, autoriza por medio del presente contrato los procedimientos que sean necesarios para el pago y acepta que dicho pago deber realizarse en la cuenta de LA EMPRESA para su posterior transferencia a la cuenta del banco indicado, considerando entonces los das establecidos en la banca para que se hagan efectivos los fondos provenientes por trasferencias entre bancos. LA EMPRESA no se hace responsable por cualquier inconveniente o requerimiento que presente el sistema de transferencias bancarias y, en virtud de ello, EL PROVEEDOR acepta tambin las deducciones que pudiere haber por concepto ");
            WriteLiteral(@"de comisiones bancarias.
                                </p>
                                <p class=""text-justify"">
                                    <b><u>CLUSULA QUINTA:</u></b> EL PROVEEDOR est de acuerdo en que el Precio de venta que pagar EL INVERSIONISTA, ser el que se publica en el Sistema TuFactoring, el cual se obtiene de la aplicacin de la frmula establecida para tal efecto en el presente instrumento. No estarn sujetas a la venta de facturas aquellas cuyo vencimiento sea menor a 30 das calendario contados a partir de la fecha de publicacin y mayor a 180 das de vencimiento desde la fecha de publicacin.
                                    La tasa de Descuentos se calcular aplicando la tasa de descuento ofrecida por EL INVERSIONISTA a travs del Sistema de Tufactoring, entendindose que ser decisin de EL PROVEEDOR si acepta o no la misma y como tal la venta de la factura, pudiendo, obviamente, rechazar dicha oferta.
                                </p>
                         ");
            WriteLiteral(@"       <p class=""text-justify"">
                                    <b><u>CLUSULA SEXTA:</u></b> Mediante el registro en el Sistema TuFactoring, EL PROVEEDOR acepta expresamente las particularidades y condiciones expresadas en este instrumento. En consecuencia, EL PROVEEDOR manifiesta su conformidad para el cobro del Precio como contraprestacin de la transmisin de los Derechos de Crdito contenidos en la Factura producto de las operaciones de venta que realice bajo las condiciones del presente contrato.
                                </p>
                                <p class=""text-justify"">
                                    <b><u> CLUSULA SPTIMA:</u></b> EL PROVEEDOR reconoce que bastar slo con la comunicacin que por el Sistema Tufactoring reciba, de que fue realizada la transferencia para que se tenga como cubierta la operacin, no hacindose responsable LA EMPRESA por mal funcionamiento del sistema de transferencias bancarias.
                                </p>
                       ");
            WriteLiteral(@"         <p class=""text-justify"">
                                    <b><u>CLUSULA OCTAVA:</u></b> EL PROVEEDOR se obliga a verificar en todo momento que las solicitudes de venta de Facturas a travs del Sistema Tufactoring, sean efectuadas por personas que tengan las facultades necesarias para ello. En este sentido, LA EMPRESA no ser responsable por prdidas econmicas derivadas de mal uso de las Claves de Acceso asignadas a EL CLIENTE.
                                </p>
                                <p class=""text-justify"">
                                    EL PROVEEDOR tendr hasta sesenta (60) minutos despus del cierre de la jornada para aceptar la venta, en caso contrario deber esperar hasta el da siguiente hbil para publicarla nuevamente. En este punto, se indica que el horario del Sistema es el siguiente: Para operaciones de consulta las 24 horas del da y los 365 das del ao; para afiliacin en el sistema  o registro de facturas, en los das hbiles bancarios en horario comprendido d");
            WriteLiteral(@"e 8:00 a.m. a 3:00 p.m.; y para la oferta y compra de facturas, en horario comprendido de 8:00 a.m. a 12:00 p.m.; siempre y cuando no existan fallos o suspensiones del servicio electrnico, elctrico o cualquier otra causa de fuerza mayor que imposibilite su empleo.
                                </p>
                                <p class=""text-justify"">
                                    La informacin e instrucciones que EL PROVEEDOR transmita o comunique mediante Sistema Tufactoring, tendrn pleno valor probatorio y fuerza legal para acreditar la operacin realizada, el importe de la misma, su naturaleza, as como las caractersticas y alcance de sus instrucciones. EL PROVEEDOR acepta que el uso de los medios de identificacin previstos en el contrato para realizar operaciones a travs del Sistema, podr equivaler a la firma autgrafa y producir los mismos efectos que las leyes otorgan a los documentos correspondientes.
                                </p>
                                <p class");
            WriteLiteral(@"=""text-justify"">
                                    <b><u>CLUSULA NOVENA:</u></b> EL PROVEEDOR entiende y acepta que la transmisin de las Facturas lleva implcito la transmisin de los Derechos de Crdito, as como todo lo que le corresponda por derecho sin reserva ni limitacin, as como de las garantas que en su caso hubiesen sido pactadas en los mismos. Ello, de conformidad con el artculo 1.552 del Cdigo Civil venezolano; no pudiendo por ninguna circunstancia negociar en forma alguna los Derechos de Crdito ya transmitidos a EL INVERSIONISTA.
                                </p>
                                <p class=""text-justify"">
                                    <b><u>CLUSULA DCIMA:</u></b> EL PROVEEDOR declara la existencia y legitimidad de los Derechos de Crdito Adquiridos y reflejados en la(s) factura(s) por l autorizadas, de conformidad con el artculo 124 del Cdigo de Comercio.
                                </p>
                                <p class=""text-justify"">
     ");
            WriteLiteral(@"                               <b><u>CLUSULA DCIMA PRIMERA:</u></b> Sin perjuicio de las indicaciones contenidas en el contrato suscrito entre EL CLIENTE y EL BANCO para hacer uso del Sistema TuFactoring, EL PROVEEDOR garantizar que las Facturas de Crdito que ceder contarn con las caractersticas que a continuacin se mencionan:
