            WriteLiteral(@"de factores de autenticacin tendentes a verificar la identidad de EL CLIENTE y de EL BANCO y la cualidad de stos para realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticacin correspondern a aquellos establecidos como Factor de autenticacin categoras 2 y 3 de acuerdo a la Resolucin N 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las Normas que Regulan el Uso de los Servicios de la Banca Electrnica, publicada en la Gaceta Oficial de la Repblica Bolivariana de Venezuela N 39.597 de fecha 19 de enero de 2011.
                                </p>
                                <p class=""text-justify"">
                                    DAS HBILES BANCARIOS: Corresponde a los das comprendidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
                                </p>
                                <p class=""text-justify"">
                           ");
            WriteLiteral(@"         DERECHO DE CRDITO: corresponde al derecho que tiene el acreedor de una deuda QUE EL CLIENTE tiene obligacin de pagar conforme a la Factura.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA PRIMERA:</b></u> Mediante el registro en el Sistema Tufactoring y la aceptacin del presente contrato de adhesin, EL INVERSIONISTA manifiesta su inters en participar en subastas para la compra de Facturas registradas previamente en el Sistema Tufactoring, en el marco de una operacin de confirming (pago a proveedores). En virtud de ello, EL INVERSIONISTA acepta expresamente las particularidades y condiciones expresadas en este instrumento.
                                </p>
                                <p class=""text-justify"">
                                    La operacin en la que participara EL INVERSIONISTA consiste en que EL PROVEEDOR (a quien EL INVERSIONISTA podr o no conocer)  una vez que haya ");
            WriteLiteral(@"aceptado la mejor oferta que arroje el Sistema Tufactoring con base en los descuentos propuestos por los distintos inversionistas, transmitir a favor de EL INVERSIONISTA ganador todos los derechos de crdito inherentes a la factura y EL BANCO garantizar a este ltimo el pago de la factura a su vencimiento por el valor neto que presenta el Sistema.
                                </p>
                                <p class=""text-justify"">
                                    <u><b> CLUSULA SEGUNDA:</b></u> EL INVERSIONISTA una vez registrado en el sistema, podr participar en el mismo ofertando por la compra de facturas registradas por los clientes de EL BANCO  y autorizadas para su venta por los proveedores respectivos, dentro de los parmetros que el propio Sistema Tufactoring fija.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA TERCERA:</b></u> EL INVERSIONISTA en caso de no tener operativa una Cuenta");
            WriteLiteral(@" en EL BANCO en el cual se depositen todos los importes correspondientes a los fondos provenientes de la liquidacin de la operacin de venta de Facturas, entiende y acepta que el pago del Precio de venta deber realizarse en la cuenta de LA EMPRESA destinada para tal fin en EL BANCO.
                                </p>
                                <p class=""text-justify"">
                                    EL INVERSIONISTA asume las tarifas bancarias establecidas por el Banco Central de Venezuela por concepto de transferencia de fondos al momento en que se realice el pago as como impuestos actuales y futuros por concepto de dbitos bancarios. En cualquier caso, de hacerse el pago a travs de una transferencia por no disponer EL INVERSIONISTA de cuenta en EL BANCO, el Sistema Tufactoring y, por tanto, LA EMPRESA ni EL BANCO sern responsables de cualquier mal funcionamiento del sistema de transferencias bancarias.
                                </p>
                                <p class=""text-j");
            WriteLiteral(@"ustify"">
                                    <u><b>CLUSULA CUARTA:</b></u> EL INVERSIONISTA est en pleno conocimiento que compite en una puja en la que participan otros inversionistas, siendo informado por el sistema en el momento en que su oferta ha sido aceptada por EL PROVEEDOR. En consecuencia, EL INVERSIONISTA acepta que no obstante realice la mejor oferta, EL PROVEEDOR pudiera rechazarla sin que ello motive compensacin ni indemnizacin alguna
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA QUINTA:</b></u> El Precio de venta que pagar EL INVERSIONISTA ganador, ser el que se obtenga en el Sistema TuFactoring, aplicando al Valor Neto de la factura la tasa de descuento ofertada EL INVERSIONISTA ganador y aceptada por EL PROVEEDOR.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA SEXTA:</b></u> EL INVERSION");
            WriteLiteral(@"ISTA est en conocimiento que EL PROVEEDOR tendr hasta sesenta (60) minutos despus del cierre de la jornada para aceptar la venta, en caso contrario se tendr como rechazada la oferta. En este punto, se indica que el horario del sistema es el siguiente: Para operaciones de consulta las 24 horas del da y los 365 das del ao; para afiliacin en el sistema  o registro de facturas, en los das hbiles bancarios en horario comprendido de 8:00 a.m. a 3:00 p.m.; y para la oferta de facturas, en horario comprendido de 8:00 a.m. a 12:00 p.m.; siempre y cuando no existan fallos o suspensiones del servicio electrnico, elctrico o cualquier otra causa de fuerza mayor que imposibilite su empleo.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA SPTIMA:</b></u> EL INVERSIONISTA acepta que bastar slo con la comunicacin que por el Sistema Tufactoring reciba respecto a que su oferta fue aceptada para realizar el pago en ");
            WriteLiteral(@"un plazo mximo de sesenta (60) minutos. Una vez transcurrido dicho lapso sin que se haya verificado el pago, la operacin queda anulada y EL INVERSIONISTA ser bloqueado en El Sistema, debiendo asumir los gastos administrativos inherentes a la operacin.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA OCTAVA:</b></u> EL BANCO podr verificar en todo momento a las personas naturales o jurdicas que se registren como inversionistas en el Sistema Tufactoring, reservndose el derecho de rechazar su inclusin en el sistema sin necesidad de declaracin o resolucin judicial, en caso de que EL INVERSIONISTA sea objeto de medidas o de investigacin por parte de algn organismo o institucin, nacional o internacional, encargado de la Prevencin de legitimacin de capitales o lavado de activos o por cualquier causa que razonablemente pudiera comprometer la seguridad de los clientes de EL BANCO.
                        ");
            WriteLiteral(@"        </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA NOVENA:</b></u> EL INVERSIONISTA conoce que EL PROVEEDOR declar la existencia y legitimidad de los Derechos de Crdito Adquiridos y reflejados en la(s) factura(s) por l autorizadas, de conformidad con el artculo 124 del Cdigo de Comercio.
                                </p>
                                <p class=""text-justify"">
                                    La informacin e instrucciones suministradas a travs del Sistema Tufactoring, tendrn pleno valor probatorio y fuerza legal para acreditar la operacin realizada, el importe de la misma, su naturaleza, as como las caractersticas y alcance de sus instrucciones. EL INVERSIONISTA conoce que el uso de los medios de identificacin previstos en el contrato para realizar operaciones a travs del Sistema, podr equivaler a la firma autgrafa y producir los mismos efectos que las leyes otorgan a los documentos correspondiente");
            WriteLiteral(@"s.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA DCIMA: </b></u> La aceptacin de la oferta hecha por EL INVERSIONISTA por parte de EL PROVEEDOR y la concrecin del pago dentro del plazo estipulado y en las condiciones determinadas en el presente instrumento, determinan la transmisin a EL INVERSIONISTA de todos los Derechos de Crdito sin reserva ni limitacin alguna. EL INVERSIONISTA recibir del propio sistema el contrato de la cesin a su favor hecha por EL PROVEEDOR.
                                </p>
                                <p class=""text-justify"">
                                    <u><b>CLUSULA DCIMA PRIMERA: </b></u> Para los efectos del presente Contrato, EL INVERSIONISTA seala como su domicilio el  indicado en el registro electrnico del Sistema Tufactoring; hasta tanto las partes intervinientes en la operacin no se notifiquen por escrito los cambios de domicilio, todas las comun");
            WriteLiteral(@"icaciones que se practiquen en los domicilios antes citados, surtirn plenamente sus  efectos.
